import React from 'react';
import './App.css';
import { Typography } from 'antd';
import { Input, Select, Icon, Button, Spin, Card } from 'antd';
import 'antd/dist/antd.css';

const { Option } = Select;
const { Title } = Typography;



function App() {
  return (
    <div>
      <Title>Steam Group Game Checker</Title>

      <Card title="Search for common games"  style={{ width: 500 }}>

        <Input addonBefore="Steam ID:" style={{marginBottom: 16}} placeholder="Please enter a Steam ID..." />

        <Button type="primary" icon="search">
          Search
        </Button>



      </Card>
    </div>
  );
}

export default App;
